import React, { Component } from 'react';

function SideBar(props) {
  return (
    <div
      style={{
        position: 'fixed',
        top: 0,
        right: 0,
        height: '100%',
        width: props.sideBarWidth,
        backgroundColor: '#f7f7f7',
        transition: '0.5s',
        overflowX: 'hidden',
        zIndex: 2
        // opacity: '0.9',
      }}
    >
      SideBar
    </div>
  );
}

export default SideBar;
